import React from 'react';
import { Container, Col, Image } from 'react-bootstrap';

const RecipePage = () => {
    const recipe = {id:1, name:'Отбивные', time:15, complex:'легко', profile_mini:'веснмпгир', profole:'сми', rating:4, img:'https://img1.russianfood.com/dycontent/images_upl/285/big_284736.jpg', userId:'1', typeId:'1'}
            
        return (
            <Container
            className="tbody">
                
                    <Image width={300} height={300} src={recipe.img}/>
                    <h2 className="namerec">{recipe.name}</h2>
                
            </Container>
        );
    
};

export default RecipePage;
